    false,nt"url": null,nt"notes": "This annual narrative report for Edwin
    B. Forsythe National Wildlife Refuge outlines Refuge accomplishments during the
    2001 calendar year. The report begins with a summary of the year's highlights and
    weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses the master plan, management plan, public participation,
    and research and investigations. Refuge administration is outlined; information
    about personnel, other manpower programs, volunteer programs, funding, and safety
    is given. Habitat management is also covered; subjects include wetlands, forests,
    grasslands, fire management, pest control, and wilderness and special areas. The
    wildlife section of the report discusses endangered and threatened species, waterfowl,
    marsh birds and waterbirds, other migratory birds, game mammals, marine mammals,
    other resident wildlife, scientific collection, animal control, marking and bird
    banding, and disease prevention and control. The public uses of the Refuge described
    in this report include outdoor classrooms, interpretive programs, hunting, fishing,
    trapping, law enforcement, and cooperating associations. The equipment and facilities
    section of the report provides information about rehabilitation, major maintenance,
    and computer systems. Refuge brochures are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
